import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import LogItem from "../log-item";

const GroupedLog = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const [groupedLogs, setGroupedLogs] = useState({item: []});
    const _renderLogs = (group) => {
        return Object
            .keys(group)
            .map((key, index) => (
                <div key={index}>
                    <p>{key}</p>


                    {
                        group[key].map((key, index) => {
                                console.log("key", key)
                                const result = [...key.reduce((mp, o) => {
                                    const key = JSON.stringify([o.direction, o.from]);
                                    if (!mp.has(key)) mp.set(key, {...o, count: 0});
                                    mp.get(key).count++;
                                    return mp;
                                }, new Map).values()];

                                console.log("result", result);
                            }
                        )

                    }

                </div>
            ));
    };
    const clearDuplicates = (group) => {
        return Object
            .values(group)
            .map((key, index) => {
                    console.log("key", key)
                    const result = [...key.reduce((mp, o) => {
                        const key = JSON.stringify([o.direction, o.from]);
                        if (!mp.has(key)) mp.set(key, {...o, count: 0});
                        mp.get(key).count++;
                        return mp;
                    }, new Map).values()];

                    console.log("result", result);
                }
            )
    }


    return (
        <React.Fragment>
            {
                _renderLogs(cdrsData)
            }
            {
                clearDuplicates(cdrsData)
            }
        </React.Fragment>
    );

};


export default GroupedLog;
